import Settings from "./components/templates/Settings";
import Template from "./components/templates/Template";
import {
  RecoilRoot,
  atom,
  selector,
  useRecoilState,
  useRecoilValue,
} from "recoil";
import { templateDetails } from "./store";

const App = () => {
  const [details, setDetails] = useRecoilState(templateDetails);

  return (
    <div className="flex">
      <div className="h-screen w-1/4 bg-gray-500">
        <Template />
      </div>
      <div className="h-screen w-1/4 bg-blue-800">
        <Settings />
      </div>
      <div className="w-1/2 bg-green-200">
        {details[0].personal_details.text !== "" && (
          <div className="flex-col">
            <div>
              <span>Personal Details</span>
            </div>
            <div>
              <span>{details[0].personal_details.text}</span>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default App;
